import React, { useState } from 'react';
import './App.css';

const Navbar = ({ setSelectedComponent }) => {
  return (
    <div className="sticky top-0 bg-white shadow-md">
      <nav className="flex justify-between items-center p-4">
        <div>
          <button onClick={() => setSelectedComponent('home')} className="px-4 py-2 hover:bg-gray-200 rounded">
            Home
          </button>
          <button onClick={() => setSelectedComponent('about')} className="px-4 py-2 hover:bg-gray-200 rounded">
            About
          </button>
          <button onClick={() => setSelectedComponent('contact')} className="px-4 py-2 hover:bg-gray-200 rounded">
            Contact
          </button>
        </div>
      </nav>
    </div>
  );
};

const MyHome = () => <div className="p-4">This is the Home component.</div>;
const About = () => <div className="p-4">This is the About component.</div>;
const Contact = () => <div className="p-4">This is the Contact component.</div>;

const Home = () => {
  const [selectedComponent, setSelectedComponent] = useState('home');

  const renderComponent = () => {
    switch (selectedComponent) {
      case 'home':
        return <Home />;
      case 'about':
        return <About />;
      case 'contact':
        return <Contact />;
      default:
        return <MyHome />;
    }
  };

  return (
    <div>
      <Navbar setSelectedComponent={setSelectedComponent} />
      <div className="container mx-auto">
        {renderComponent()}
      </div>
    </div>
  );
};

export default Home;
